export const getLandingPageRequest = function(){
  return {
    type: "GET_LANDING_PAGE_REQUEST"
  }
}

export const getLandingPageSuccess = function(landingPage) {
  return {
    type: "GET_LANDING_PAGE_SUCCESS",
    landingPage
  }
}

export const getLandingPageError = function(data) {
  return {
    type: "GET_LANDING_PAGE_ERROR",
    data
  }
}
